import React from 'react';
import './Home.css';
import 'materialize-css/dist/css/materialize.min.css';

const Home = () => {
  return (
    <div className='container'>
      <h1> Welcome to the landing Page</h1>

      <div class='video-container'>
        <iframe
          width='853'
          height='480'
          src='//www.youtube.com/embed/Q8TXgCzxEnw?rel=0'
          frameborder='0'
          allowfullscreen
        ></iframe>
      </div>
    </div>
  );
};

export default Home;
